import * as React from "react";
import { styled, alpha } from "@mui/material/styles";
import {
    AppBar,
    Box,
    Toolbar,
    Typography,
    InputBase,
    IconButton,
    Paper,
    Fab,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import SearchIcon from "@mui/icons-material/Search";
import EditIcon from "@mui/icons-material/Edit";
import AddIcon from "@mui/icons-material/Add";
import { ThemeProvider, createTheme } from "@mui/material/styles";

const darkTheme = createTheme({
    palette: {
        mode: "dark",
    },
});

const Search = styled("div")(({ theme }) => ({
    position: "relative",
    borderRadius: theme.shape.borderRadius,
    backgroundColor: alpha(theme.palette.common.white, 0.15),
    "&:hover": {
        backgroundColor: alpha(theme.palette.common.white, 0.25),
    },
    marginLeft: 0,
    width: "100%",
    [theme.breakpoints.up("sm")]: {
        marginLeft: theme.spacing(1),
        width: "auto",
    },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
    padding: theme.spacing(0, 2),
    height: "100%",
    position: "absolute",
    pointerEvents: "none",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
    color: "inherit",
    "& .MuiInputBase-input": {
        padding: theme.spacing(1, 1, 1, 0),
        // vertical padding + font size from searchIcon
        paddingLeft: `calc(1em + ${theme.spacing(4)})`,
        transition: theme.transitions.create("width"),
        width: "100%",
        [theme.breakpoints.up("sm")]: {
            width: "12ch",
            "&:focus": {
                width: "20ch",
            },
        },
    },
}));

export default function Home() {
    let rows = 1;

    const handleAddPage = () => {
        if (rows > 20) return;
        rows++;

        let ss;

        console.log(
            document.getElementById("A"),
            document.getElementById("B"),
            document.getElementById("C"),
            document.getElementById("D"),
        );
        if (rows <= 5) ss = document.getElementById("A").innerHTML;
        else if (rows >= 10 && rows <= 11)
            ss = document.getElementById("B").innerHTML;
        else if (rows >= 11 && rows < 15)
            ss = document.getElementById("C").innerHTML;
        else if (rows >= 15) ss = document.getElementById("D").innerHTML;

        document.getElementById("Page").style.maxWidth = rows * 400 + "px";

        document.getElementById("Page").innerHTML += ss;
    };
    return (
        <ThemeProvider theme={darkTheme}>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static">
                    <Toolbar>
                        <IconButton
                            size="large"
                            edge="start"
                            color="inherit"
                            aria-label="open drawer"
                            sx={{ mr: 2 }}
                        >
                            <MenuIcon />
                        </IconButton>
                        <Typography
                            variant="h6"
                            noWrap
                            component="div"
                            sx={{
                                flexGrow: 1,
                                display: { xs: "none", sm: "block" },
                            }}
                        >
                            Pages
                        </Typography>
                        <Search>
                            <SearchIconWrapper>
                                <SearchIcon />
                            </SearchIconWrapper>
                            <StyledInputBase
                                placeholder="Search…"
                                inputProps={{ "aria-label": "search" }}
                            />
                        </Search>
                    </Toolbar>
                </AppBar>
            </Box>

            <div id="A" style={{ display: "none" }}>
                <Paper
                    sx={{ minWidth: 300, maxHeight: 200 }}
                    className="space-between"
                >
                    <div className="buttons">
                        <Fab color="primary" aria-label="add">
                            <EditIcon />
                        </Fab>
                    </div>
                </Paper>
            </div>
            <div id="B" style={{ display: "none" }}>
                <Paper
                    sx={{ minWidth: 300, maxHeight: 200 }}
                    className="space-between"
                >
                    <div className="buttons">
                        <Fab color="primary" aria-label="add">
                            <EditIcon />
                        </Fab>
                    </div>
                </Paper>
            </div>
            <div id="C" style={{ display: "none" }}>
                <Paper
                    sx={{ minWidth: 300, maxHeight: 200 }}
                    className="space-between"
                >
                    <div className="buttons">
                        <Fab color="primary" aria-label="add">
                            <EditIcon />
                        </Fab>
                    </div>
                </Paper>
            </div>
            <div id="D" style={{ display: "none" }}>
                <Paper
                    sx={{ minWidth: 300, maxHeight: 200 }}
                    className="space-between"
                >
                    <div className="buttons">
                        <Fab color="primary" aria-label="add">
                            <EditIcon />
                        </Fab>
                    </div>
                </Paper>
            </div>
            <div className="Pages" id="Page">
                <Paper
                    sx={{ minWidth: 300, maxHeight: 200 }}
                    className="space-between"
                >
                    <div className="buttons">
                        <Fab color="primary" aria-label="add">
                            <EditIcon />
                        </Fab>
                    </div>
                </Paper>
            </div>
            <div className="AddPages">
                <Fab
                    color="primary"
                    aria-label="add"
                    onClick={() => handleAddPage()}
                >
                    <AddIcon />
                </Fab>
            </div>
        </ThemeProvider>
    );
}
